import React, {  useState } from 'react';


function StateExmaple () {
    let [count, setCount] = useState(0);
    let handlerincrement = () => {


        if(count < 10) {
            let countplus = count + 1
            setCount(countplus)
        }

    }

    let handlerdncrement = () => {


      if(count > 0) {
        let countplus = count - 1

        setCount(countplus)


      }
        


   
    }
    return (
        <div>
            <button onClick={handlerincrement} className={`m-2 ${count < 10 ? "btn btn-success": 'btn btn-dark' }`} disabled={count >= 10}>+</button>
            <button onClick={handlerdncrement} className={`m-2 ${count > 0 ? "btn btn-success": 'btn btn-dark' }`}  disabled={count <= 0}>-</button>
            <label>count is: {count} </label>
       
        </div>
    )
}

export default StateExmaple
